import React from 'react';
import './moneyTable.scss';
import { Card } from 'antd';
import { Row, Col, Tabs } from 'antd';
import { Table } from 'antd';

const MoneyTable = () => {
    const columns = [
        {
            title: '순위',
            dataIndex: 'rank',
          },
        {
          title: '기업',
          dataIndex: 'name',
        },
        {
            title: '기본급',
            dataIndex: 'base',
        },
        {
            title: '고정수당',
            dataIndex: 'fixed',
        },
        {
            title: '실적수당',
            dataIndex: 'performance',
        },
        {
            title: '급여성 복리후생비',
            dataIndex: 'welfare',
        },
        {
            title: '성과상엽금',
            dataIndex: 'bonus',
        },
        {
            title: '경영평과 성과급',
            dataIndex: 'manage',
        },
        {
            title: '합계',
            dataIndex: 'total',
            sorter: {
                compare: (a, b) => a.total - b.total,
                multiple: 1,
            },
        },
      ];

      const data = [
        {
          key: '1',
          name: 'John Brown',
          chinese: 98,
          math: 60,
          english: 70,
        },
        {
          key: '2',
          name: 'Jim Green',
          chinese: 98,
          math: 66,
          english: 89,
        },
        {
          key: '3',
          name: 'Joe Black',
          chinese: 98,
          math: 90,
          english: 70,
        },
        {
          key: '4',
          name: 'Jim Red',
          chinese: 88,
          math: 99,
          english: 89,
        },
      ];

    return (
        <Card type="inner" title="전체 연봉">
            <Tabs defaultActiveKey="1" centered>
                <Tabs.TabPane tab="초봉" key="1">
                    <Row>
                        <Col span={24}>
                            <Table columns={columns} dataSource={data}  />
                        </Col>
                    </Row>                                    
                </Tabs.TabPane>
                <Tabs.TabPane tab="평균연봉" key="2">
                    Content of Tab Pane 2
                </Tabs.TabPane>
            </Tabs>
        </Card>
    );
};

export default MoneyTable;
